import React from "react";

export default function Home() {
  /* ======= STYLE OBJECTS ======= */
  const colors = {
    black: "#000",
    white: "#fff",
    red: "#c8102e",
    redLight: "#d14556",
    pinkLine: "#c05b66",
    footerRed: "#b92634",
  };

  const page = { fontFamily: "'Be Vietnam Pro','Montserrat',Arial,sans-serif", color: colors.white, background: colors.black };

  const navBar = { background: colors.black, height: 70, display: "flex", alignItems: "center" };
  const navInner = { width: "90%", maxWidth: 1200, margin: "0 auto", display: "flex", justifyContent: "space-between", alignItems: "center" };
  const menu = { display: "flex", gap: 34, fontWeight: 600, fontSize: "0.9rem" };

  const ctaRed = { background: colors.red, padding: "60px 0" };
  const ctaGrid = { width: "90%", maxWidth: 1200, margin: "0 auto", display: "grid", gap: 40, gridTemplateColumns: "repeat(auto-fit,minmax(320px,1fr))" };

  const ctaTextH2 = { fontSize: "2rem", fontWeight: 900, lineHeight: 1.3 };
  const ctaTextP  = { marginTop: 16, fontSize: ".9rem", maxWidth: 260 };

  const input = { flex: 1, padding: "14px 16px", background: colors.redLight, border: "none", color: colors.white, fontSize: ".8rem", letterSpacing: ".8px" };
  const textarea = { ...input, resize: "none" };
  const sendBtn = { marginTop: 10, padding: "10px 24px", background: "none", border: `2px solid ${colors.white}`, color: colors.white, fontWeight: 600, cursor: "pointer" };

  const dividerBlack = { height: 8, background: colors.black };
  const dividerPink  = { height: 8, background: colors.pinkLine };

  const ctaBlack   = { background: colors.black, padding: "120px 0" };
  const btnContact = { background: colors.red, padding: "26px 90px", fontWeight: 700, border: "none", letterSpacing: 1, cursor: "pointer", marginLeft: "auto" };

  const footer = { background: colors.footerRed, padding: "26px 10%", fontSize: ".9rem", letterSpacing: 1 };

  /* ======= JSX ======= */
  return (
    <div style={page}>

      {/* NAVBAR */}
      <header style={navBar}>
        <div style={navInner}>
          <img src="/logo.png" alt="Beastmode" style={{ height: 60 }} />
          <nav style={menu}>
            {["TRANG CHỦ","VỀ CHÚNG TÔI","KẾT QUẢ","SẢN PHẨM","MẶT HÀNG","MỨC GIÁ"]
              .map(txt => <a key={txt} href="#" style={{ color: colors.white }}>{txt}</a>)}
          </nav>
        </div>
      </header>

      {/* RED CTA */}
      <section style={ctaRed}>
        <div style={ctaGrid}>
          {/* Left text */}
          <div>
            <h2 style={ctaTextH2}>
              BẠN ĐÃ SẴN SÀNG ĐỂ<br /><span>THAY ĐỔI?</span>
            </h2>
            <p style={ctaTextP}>Hãy để lại thông tin của bạn và chúng tôi sẽ liên hệ với bạn sớm nhất có thể</p>
          </div>

          {/* Right form */}
          <form style={{ width: "100%" }} onSubmit={e => e.preventDefault()}>
            <div style={{ display:"flex", gap:24, marginBottom:20 }}>
              <input placeholder="HỌ VÀ TÊN" style={input}/>
              <input placeholder="SỐ ĐIỆN THOẠI" style={input}/>
            </div>
            <div style={{ display:"flex", gap:24, marginBottom:20 }}>
              <input placeholder="NƠI Ở HIỆN TẠI" style={input}/>
              <input placeholder="MỤC TIÊU LUYỆN TẬP" style={input}/>
            </div>
            <textarea rows={4} placeholder="VẤN ĐỀ BẠN ĐANG GẶP PHẢI" style={textarea}/>
            <button type="submit" style={sendBtn}>GỬI THÔNG TIN</button>
          </form>
        </div>
      </section>

      {/* DIVIDERS */}
      <div style={dividerBlack} />
      <div style={dividerPink} />

      {/* BLACK SECTION */}
      <section style={ctaBlack}>
        <div style={{ width:"90%",maxWidth:1200,margin:"0 auto" }}>
          <button style={btnContact}>LIÊN HỆ CHÚNG TÔI</button>
        </div>
      </section>

      {/* FOOTER */}
      <footer style={footer}>
        <p>COPYRIGHT 2025 ©</p>
      </footer>
    </div>
  );
}
